/*
Given a non-empty 2D matrix matrix and an integer k, find the max sum of a rectangle in the matrix such that its sum is no larger than k.

Example:

Input: matrix = [[1,0,1],[0,-2,3]], k = 2
Output: 2 
Explanation: Because the sum of rectangle [[0, 1], [-2, 3]] is 2,
             and 2 is the max number no larger than k (k = 2).
Note:

The rectangle inside the matrix must have an area > 0.
What if the number of rows is much larger than the number of columns?
Accepted
50,653
Submissions
132,427
*/

// naive strategy
var maxSumSubmatrix = function (matrix, k) {
  let maxSmaller = Number.MIN_SAFE_INTEGER;

  const sums = new Array(matrix.length + 1).fill(0)
    .map(() => new Array(matrix[0].length + 1).fill(0))

  for (let i = 0; i < matrix.length; i += 1) {
    for (let j = 0; j < matrix[0].length; j += 1) {
      sums[i + 1][j + 1] = matrix[i][j] + sums[i][j + 1] + sums[i + 1][j] - sums[i][j];

      let currSum = sums[i + 1][j + 1];
      for (let r = 0; r <= i; r += 1) {
        for (let c = 0; c <= j; c += 1) {
          const nextSum = currSum - sums[r][j + 1] - sums[i + 1][c] + sums[r][c];
          if (nextSum <= k) {
            maxSmaller = Math.max(maxSmaller, nextSum);
            if (nextSum === k) return k;
          }
        }
      }
    }
  }

  return maxSmaller;
};

